import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtnGroup,
  MDBIcon
} from "mdbreact";
import "../index.css";
import AnimationPage from './Animation';
import './scrollbar.css';
import Events from './events';
import LightboxPage from './gallery';
import Brochure from './brochure';
import Testimonials from './testimonials';
import Contact from './contact';
import Footer from './footer';
import Particles from 'react-particles-js';


class AppPage extends React.Component {
  state = {
    collapsed: false
  };

  handleTogglerClick = () => {
    this.setState({
      collapsed: !this.state.collapsed
    });
  };

  render() {
    const overlay = (
      <div
        id="sidenav-overlay"
        style={{ backgroundColor: "transparent" }}
        onClick={this.handleTogglerClick}
      />
    );
    return (
      <div id="apppage">

       <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 200,
	            "density": {
	                "enable": false
	            }
	        },
	        "size": {
	            "value": 8,
	            "random": true
	        },
	        "move": {
	            "direction": "bottom",
	            "out_mode": "out"
	        },
	        "line_linked": {
	            "enable": false
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onclick": {
	                "enable": true,
	                "mode": "remove"
	            }
	        },
	        "modes": {
	            "remove": {
	                "particles_nb": 10
	            }
	        }
	    }
	}} 
        style={{
            position : "absolute" ,
     background : "black"
  }} />
        <Router>
          <div>
            <MDBNavbar
            style={{opacity:"0.9"}}
              color="black"
              
              dark
              expand="md"
              fixed="top"
              scrolling
              transparent
            >
              <MDBContainer>
                <MDBNavbarBrand>
                  <strong className="white-text">Inceptra'20</strong>
                </MDBNavbarBrand>
                
                  <MDBNavbarNav right>
                    <MDBNavItem>
                    <MDBNavItem>
                      <MDBNavLink to="#!">Register</MDBNavLink>
                    </MDBNavItem>
                    </MDBNavItem>
                  </MDBNavbarNav>
               
              </MDBContainer>
            </MDBNavbar>
        
          </div>
        </Router>
        <MDBView>
          <MDBMask className="d-flex justify-content-center align-items-center gradient">
            <MDBContainer>
              <MDBRow id="home">
                <MDBCol
                  md="6"
                  className="white-text text-center text-md-left mt-xl-5 mb-5"
                >
                  <MDBAnimation type="fadeInLeft" delay=".4s">
                  <h1 className="h1-responsive font-weight-bold mt-sm-5">
                     INCEPTRA  <small style={{color:"white",fontSize:"1rem",padding:"1rem"}}>X Recursion</small>
                    </h1>
                    
                    <hr className="hr-light" />
                    <h6 className="mb-4">
                      Lorem ipsum dolor sit amet, consectetur adipisicing elit.
                      Rem repellendus quasi fuga nesciunt dolorum nulla magnam
                      veniam sapiente, fugiat! Commodi sequi non animi ea dolor
                      molestiae iste.
                    </h6>
                    <MDBBtn color="white" style={{color :"black"} }>Register Yourself</MDBBtn>
                    <a href="https://www.google.com" target="_blank">
                    <MDBBtn outline color="white">
                      Brochure
                    </MDBBtn>
                    </a>
                  </MDBAnimation>
                </MDBCol>

                <MDBCol md="6" xl="5" className="mt-xl-5">
                  <MDBAnimation type="fadeInRight" delay=".4s">
                   
                  </MDBAnimation>
                </MDBCol>
              </MDBRow>
            </MDBContainer>
          </MDBMask>
        </MDBView>
      <br/>
      <br/>
  <div id="cards">
      <Events/>
      </div>
      <LightboxPage/>
    
      <br/><br/>
      <Brochure/>
      <br/><br/>
      <Testimonials />
      <br/><br/>
      <Contact />
      <br/><br/>
      
     
     
      <br/><br/>
      <Footer />
      </div>
    );
  }
}

export default AppPage;
